#
# TABLE STRUCTURE FOR: autopart
#

DROP TABLE IF EXISTS `autopart`;

CREATE TABLE `autopart` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор сроки',
  `autopart` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название автозапчасти',
  `car_year_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на год выпуска авто',
  `autopart_category_id` int(10) unsigned NOT NULL COMMENT 'Ссылка категорию автозапчасти',
  `manufacturer_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на производителя автозапчасти',
  `article` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Артикул',
  `provider_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на поставщика',
  `price` float unsigned NOT NULL COMMENT 'Цена',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=501 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Автозапчасти';



#
# TABLE STRUCTURE FOR: autopart_category
#

DROP TABLE IF EXISTS `autopart_category`;

CREATE TABLE `autopart_category` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор сроки',
  `autopart_category` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название категории автозапчасти',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=11 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Категории автозапчастей';



#
# TABLE STRUCTURE FOR: buyer_category
#

DROP TABLE IF EXISTS `buyer_category`;

CREATE TABLE `buyer_category` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `buyer_category` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название категории пользователя',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=3 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Категории пользователей';



#
# TABLE STRUCTURE FOR: buyers
#

DROP TABLE IF EXISTS `buyers`;

CREATE TABLE `buyers` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `buyer_category_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на категорию покупателя',
  `first_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Имя пользователя(контактное лицо)',
  `last_name` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Фамилия пользователя(контактное лицо)',
  `email` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Почта(КЛ)',
  `phone` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Телефон(КЛ)',
  `adress` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Адрес',
  `legal_person_name` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Наименование юридического лица',
  `inn` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'ИНН(ЮЛ)',
  `kpp` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'КПП(ЮЛ)',
  `payment_account` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Р/с(ЮЛ)',
  `bank` varchar(150) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'Банк(ЮЛ)',
  `bic` varchar(50) COLLATE utf8_unicode_ci DEFAULT NULL COMMENT 'БИК(ЮЛ)',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Покупатели';



#
