  UNIQUE KEY `car_brand` (`car_brand`)
) ENGINE=InnoDB AUTO_INCREMENT=51 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Бренды автомобилей';



#
