) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Производители';



#
# TABLE STRUCTURE FOR: orders
#

DROP TABLE IF EXISTS `orders`;

CREATE TABLE `orders` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор строки',
  `buyer_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на покупателя',
  `order_sum` float unsigned NOT NULL COMMENT 'Сумма заказа',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=101 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Заказы';



#
# TABLE STRUCTURE FOR: orders_autopart
#

DROP TABLE IF EXISTS `orders_autopart`;

CREATE TABLE `orders_autopart` (
  `order_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на заказ',
  `autopart_id` int(10) unsigned NOT NULL COMMENT 'Ссылка на автозапчасть',
  `count_autopart` int(10) unsigned NOT NULL COMMENT 'Кол-во автозапчастей',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  PRIMARY KEY (`order_id`,`autopart_id`) COMMENT 'Составной первичный ключ'
) ENGINE=InnoDB DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Автозапчасти, вошедшие в заказ. Связь между заказом и автозапчастями';



#
# TABLE STRUCTURE FOR: provider
#

DROP TABLE IF EXISTS `provider`;

CREATE TABLE `provider` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'Идентификатор сроки',
  `provider` varchar(150) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Название поставщика',
  `city` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Город',
  `about_of` text COLLATE utf8_unicode_ci NOT NULL COMMENT 'Информация о поставщике',
  `website` varchar(100) COLLATE utf8_unicode_ci NOT NULL COMMENT 'Вебсайт поставщика',
  `created_at` datetime DEFAULT current_timestamp() COMMENT 'Время создания строки',
  `updated_at` datetime DEFAULT current_timestamp() ON UPDATE current_timestamp() COMMENT 'Время обновления строки',
  PRIMARY KEY (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=6 DEFAULT CHARSET=utf8 COLLATE=utf8_unicode_ci COMMENT='Поставщики';



